odd.p:
Het betreft de originelen van de gedrukte uitgave uit 1921;
de ontwerpen van J. Stuyt en J. Limburg zijn in het bezit van het Nederlands Architectuur Instituut;
het ontwerp van H.P. Berlage is tot op heden zoek.
zie voor de voorbereiding van de prijsvraag het archief Ministerie van Waterstaat 1906-1945 (code 2.16.05) dossier 353, 1913-1914.

Bestektekeningen horen bij bestek nr 22 1913-1915;
zijn tevens bijlage van 2190/1887 Kunsten en Wetenschappen.
revisietekeningen bijgewerkt tot 1940.

Indien niet verder aangegeven betreft het foto's van het exterieur gemaakt voor en na restauratie- c.q. uitbreidingswerken, bij oplevering enzovoort.
De eerste vier nummers (1612-1615) zijn samengestelde collecties aangetroffen bij de Regionale Directie Gelderland, Overijssel en Flevoland;
de laatste nummers (1710-1715) zijn meerdere foto's op 1 blad bijeengebracht, foto's van onbekende objecten en bijzondere onderwerpen
